import React from 'react';
import java from './images/java.png';
import html from './images/html.png';
import css from './images/css.png';
import jquery from './images/jquery.png';
import react from './images/react.png';
import './index.css';
import langicon from './images/languagelogo.png';

export default function Languages() {


    return (
        <div>
        <h1 style={{display: 'flex', marginLeft: '20px', fontSize: '50px', alignItems: 'center'}}><img src={langicon} style={{height: '80px', width: '80px'}}/>LANGUAGES</h1>
        <div className='languages-container' style={{display: 'flex', alignItems: 'center', justifyContent: 'center'}}>
            <img src={html} className='image' style={{
                height: '270px',
                width: '200px',
                padding: '20px'
            }} />
            <img src={css} className='image' 
            style={{
                height: '250px',
                width: '200px',
                padding: '20px'
            }}/>
            <img src={java} className='image' style={{
                height: '250px',
                width: '200px',
                padding: '20px'
            }}/>
            <img src={jquery} className='image' style={{
                height: '100px',
                width: '400px',
                padding: '20px'
            }}/>
            <img src={react} className='image' style={{
                height: '110px',
                width: '320px',
                padding: '20px'
            }}/>

        </div>
    </div>
    )
}
